'use strict';

exports.createOrganization = function(args, res, next) {
  /**
   * Create organization
   * Create an organization. A name must be provided
   *
   * body OrganizationDTO  (optional)
   * returns OrganizationDTO
   **/
  var examples = {};
  examples['application/json'] = {
  "name" : "aeiou",
  "id" : "aeiou"
};
  if (Object.keys(examples).length > 0) {
    res.setHeader('Content-Type', 'application/json');
    res.end(JSON.stringify(examples[Object.keys(examples)[0]] || {}, null, 2));
  } else {
    res.end();
  }
}

